import React from "react";


function Daily(){
    return (
        <div className="daily">
        
        <p1>Thu 21</p1>
       
        <br></br>
        <img src="src\weather-icons\10d@2x.png"></img>
        <br></br>
        <p1 className="tempdailyhigh">39      </p1>
     
        <p1 className="tempdailylow">21</p1>
        <br>
        </br>
        <p1>Sunny</p1>
        

        </div>

    );


}
export default Daily;
